import React from "react";
import Navbar from "../Components/Navbar";
import { Container } from "../Components/styled";

const HomePage = () => {
  return (
    <Container>
      <Navbar />
      <h1>Home Page</h1>
    </Container>
  );
};

export default HomePage;
